import React from 'react';
import './index.css';

export default function Home() {
    return (
        <div style={{
            boxSizing: 'border-box',
            margin: '0',
            padding: '0',
            backgroundColor: 'lavender',
            position: 'fixed',
            top: '0px',
            left: '0',
            zIndex: '999',
            width: '100%',

            display: 'flex',
            gridTemplateColumns: 'repeat(3, 1fr)',
            gridTemplateRows: '100%',
            gridGap: '10px',
            justifyContent: 'center',
            alignContent: 'center',
            borderBottom: '100px solid white'
        }
        }>
            <h1 style={{
                display: 'flex',
                position: 'relative',
                top: '350px',
                fontSize: '60px',
                fontWeight: 'bold'
            }}>TAYLER RADCLIFFE</h1>


        </div>
    )
}
